import { obtenerConexion, sql } from '../database/conexion.js';

// Obtener todos los vehículos
export const obtenerVehiculos = async (req, res) => {
    const conexion = await obtenerConexion();
    const resultado = await conexion.request().query('SELECT * FROM TARIFAS');
    console.log(resultado); // Resultado en consola (DEV)
    res.json(resultado.recordset); // Resultado al navegador
}

// Mostrar los vehículos en función del ID
export const obtenerConexionID = async (req, res) => {
    const { IDTARIFA } = req.params;
    const conexion = await obtenerConexion();
    const resultado = await conexion.request()
        .input('IDTARIFA', sql.Int, IDTARIFA)
        .query("SELECT * FROM TARIFAS WHERE IDTARIFA = @IDTARIFA");

    console.log(resultado); // Resultado en consola (DEV)
    res.json(resultado.recordset); // Resultado al navegador
}


export const obtenerVehiculosPlaca = async (req, res) => {
    const { placaVehiculo } = req.params;
    const conexion = await obtenerConexion();
    const resultado = await conexion.request()
        .input('placaVehiculo', sql.VarChar, placaVehiculo)
        .query("SELECT * FROM Vehiculo WHERE placaVehiculo = @placaVehiculo");

    console.log("Resultado:", resultado);
    res.json(resultado.recordset);

};

export const insertarVehiculo = async (req, res) => {
    try {
        const { placaVehiculo, descripcionVehiculo, modeloVehiculo, anioFab, propietario } = req.body;

        // Validación de parámetros
        if (!placaVehiculo || !descripcionVehiculo || !modeloVehiculo || !anioFab || !propietario) {
            return res.status(400).json({ message: 'Parámetros insuficientes.' });
        }

        const conexion = await obtenerConexion();
        const resultado = await conexion.request()
            .input('placaVehiculo', sql.VarChar, placaVehiculo)
            .input('descripcionVehiculo', sql.VarChar, descripcionVehiculo)
            .input('modeloVehiculo', sql.VarChar, modeloVehiculo)
            .input('anioFab', sql.Int, anioFab)
            .input('propietario', sql.VarChar, propietario)
            .query("INSERT INTO Vehiculo (placaVehiculo, descripcionVehiculo, modeloVehiculo, anioFab, propietario) VALUES (@placaVehiculo, @descripcionVehiculo, @modeloVehiculo, @anioFab, @propietario)");

        console.log(resultado);

        res.status(201).json({
            message: "Vehículo insertado exitosamente",
            datos: { placaVehiculo, descripcionVehiculo, modeloVehiculo, anioFab, propietario }
        });
    } catch (error) {
        console.error("Error al insertar vehículo:", error);
        res.status(500).json({ message: "Error del servidor" });
    }
}

export const eliminarDatos = async (req, res) => {
    const { idVehiculos } = req.params;
    const conexion = await obtenerConexion();
    const resultado = await conexion.request()
        .input('idVehiculos', sql.Int, idVehiculos)
        .query("DELETE FROM Vehiculo WHERE idVehiculos = @idVehiculos");

    console.log(resultado); // Resultado en consola (DEV)
    res.json(resultado.recordset); // Resultado al navegador
}

